INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8001, 6001, 1, 'Whispers of Serenity', 'An enchanting oil painting depicting a tranquil lakeside landscape at sunset. The artist\'s meticulous brushwork captures the soft ripples on the water, the vibrant hues of the sky, and the serene atmosphere of nature\'s embrace. The artwork emanates a sense of peace and invites viewers to immerse themselves in its serene beauty.', '36\" x 24\"', '4500', , , , 5);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8002, 6002, 2, 'Eternal Dance', 'A mesmerizing bronze sculpture capturing the essence of two figures engaged in an eternal dance. The artist masterfully molds the bronze, showcasing the intricate intertwining of their bodies and evoking a sense of grace and harmony. This artwork symbolizes the enduring bond of love and unity.', '18\" x 10\" x 8', '7200', , , , 2);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8003, 6003, 3, 'The Enigmatic Muse', 'This captivating mixed-media artwork combines acrylic, collage, and ink to create a layered composition. The artist\'s creative interplay of textures and colors brings forth a mysterious muse lost in thought, encouraging viewers to contemplate her story and find personal interpretations within the artwork\'s depths.', '30\" x 40\"', '2800', , , , 1);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8004, 6004, 4, 'Surreal Symphony', ' A captivating large-scale abstract painting that bursts with vibrant colors and bold brushstrokes. The artist\'s free-flowing expression and imaginative use of shapes create a surreal symphony on the canvas. Viewers are invited to explore this vibrant world where reality intertwines with the depths of the subconscious mind.', '48\" x 36\"', '5500', , , , 5);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8005, 6001, 5, 'Urban Perspectives', 'This photography series offers unique perspectives of bustling cityscapes from unexpected angles. The artist skillfully captures the energy and essence of urban life, emphasizing the beauty found within the chaotic environments. These thought-provoking images invite viewers to reflect on the modern world and human connection.', 'Various sizes', '800', , , , 4);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8007, 6002, 7, 'Melancholic Melodies', 'This evocative charcoal drawing conveys profound emotions through a poignant portrait. The artist captures the essence of melancholy, inviting viewers to contemplate the complexities of the human soul and reflect upon the fleeting nature of existence.', '22\" x 18\"', '1500', , , , 3);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8008, 6003, 1, 'Nature\'s Tapestry', 'This captivating mixed media collage combines intricate paper cutouts, acrylic paint, and textured elements. Inspired by the diverse beauty of the natural world, the artist skillfully creates a textured tapestry of flora and fauna, inviting viewers to immerse themselves in the intricacies of nature\'s delicate balance.', '30\" x 22\"', '1800', , , , 1);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8009, 6004, 9, 'Abstract Reverie', 'A vibrant abstract artwork that ignites the imagination with its bold colors and dynamic compositions. The artist\'s expressive brushwork and spontaneous approach create a visual symphony of energy and movement. Viewers are encouraged to delve into their own reverie and find personal meaning within the abstract forms.', '36\" x 24\"', '3200', , , , 3);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8010, 6001, 10, 'Timeless Reflections', 'This captivating sculpture crafted from polished stainless steel offers reflective surfaces and abstract shapes. The artwork symbolizes the fluidity of time and the ever-changing nature of existence. Its contemporary aesthetics and thought-provoking qualities make it a timeless piece that sparks contemplation.', '12\" x 12\" x 1', '2200', , , , 4);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8011, 6002, 11, 'Harmony in Chaos', 'A thought-provoking mixed media artwork that combines acrylic paint and found objects. The artist explores the delicate balance between order and chaos, harmoniously integrating diverse elements into a visually striking composition. This artwork invites viewers to ponder the coexistence of opposing forces in the world around us.', '24\" x 18\"', '1800', , , , 2);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8013, 6003, 13, 'Embracing Diversity', 'An impactful installation art piece that utilizes a variety of materials to symbolize unity, and inclusivity, and celebrate the beauty of diversity in all its forms. This thought-provoking artwork engages viewers on a profound level, encouraging dialogue and reflection.', 'Variable depe', '1800', , , , 3);
INSERT INTO `artwork` (`artId`, `categoryId`, `userId`, `artName`, `artDetails`, `artDimensions`, `artPrice`, `artPicture1`, `artPicture2`, `artPicture3`, `artRating`) VALUES
(8015, 6004, 15, 'Fragments of Time', 'A captivating series of mixed media artworks that incorporate vintage photographs, collages, and acrylic paint. The artist explores themes of memory, nostalgia, and the passage of time, piecing together fragments of the past to create visually stunning compositions filled with depth and emotion.', 'Various sizes', '1600', , , , 5);

